function saveData() {
    localStorage.setItem("product", JSON.stringify(listUser));
}
function getData() {
    listUser = JSON.parse(localStorage.getItem("product"));
}
function showData() {
    if (localStorage.getItem("product") != null) {
    getData();
    } else {
    saveData();
    }
    document.getElementById("user").innerHTML = formatData(listUser).join("");
}
function formatData() { 
    for (let user of listUser) {
        var html = `
            <tr>
                <td>${user.email}</td>
                <td>${user.pass}</td>
            </tr>
        `;
    }
}
